import React from 'react';
import '../styles/App.css';
import TaskList from './TaskList';

const appStyle = {
  margin: '20px',
  backgroundColor: 'black'
};

class App extends React.Component {
  render() {
    return (
      <div className="App" style={appStyle}>
        <TaskList />
      </div>
    );
  }
}

export default App;
